import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import * as serviceWorker from './serviceWorker';

class Show extends React.Component {
    constructor(props){
        super(props);
        this.state = {
            name:"input",
            count:0,
        }
    }
    render() {
        if (this.state %2 == 0){
            return (
                <div>
                <header>12312312</header>
                <button name="cool" onClick={() => {
                    var count = this.state.count + 1
                    this.setState({count:count})
                }}>cool</button>
                <body>
                    hello js
                </body>
                <body>icount is {this.state.count}</body>
                </div>
            );
        }
        else{
            return (
                <div>
                <header>12312312</header>
                <button name="cool" onClick={() => {
                    var count = this.state.count + 1
                    this.setState({count:count})
                }}>cool</button>
                <body>哇哈哈哈
                </body>
                <body>icount is {this.state.count}</body>
                </div>
            );
        }
    }
}

ReactDOM.render(<Show/>, document.getElementById('root'))

